import random

ans = 0

for i in range(170):
	ans *= 10 ** 50
	ans += 5 ** random.randint(1, 100)

print(ans)

t = True

def f(x) :
	r = 0
	while x > 0:
		r += x % 10
		x //= 10
	return r

for i in range(50):
	if f(ans * (2 ** i)) <= f(ans * (2 ** (i + 1))):
		t = False
	if not t:
		print(i)
